import NavItem from "./NavItem";
import { useState } from "react";


export default function Navbar (){  

    let state = useState(['HomeState', 'CatalogState', 'AboutState', 'ContactState']);
    
    return(
        <nav-bar>
            {state[0].map(x => <NavItem href='#' text = {x} />)}
        </nav-bar>
    );
}
